import styled from "styled-components";
import { NavItem } from "./NavItem";

const FooterContainer = styled.div`
  width: 100%;
  height: 200px;
  margin-top: 30px;
  border-top: 1px solid #1a1b24;
  box-sizing: border-box;
  transition: all 0.3s;
  padding: 0 32px 0 240px;
`;

const FooterContent = styled.div`
  padding: 20px;
`;

const BoldText = styled.p`
  font-size: 22px;
  font-weight: 1000;
  color: #bbbece;
  letter-spacing: 2px;
`;

const NormalText = styled.pre`
  font-size: 14px;
  color: #393d50;
`;

const Icon = styled.div`
  display: block;
`;
export function Footer() {
  return (
    <FooterContainer>
      <FooterContent>
        <BoldText>전화번호 : 02.1234.5678</BoldText>
        <BoldText>이메일 : LMS@lms.com</BoldText>
        <NormalText>
          AM 10:00 - PM 08:00 Off-time PM 12:00 - PM 02:00
        </NormalText>
        <NormalText>DAY OFF (SUNDAY, HOLIDAY)</NormalText>
        <BoldText>LMS 프로젝트 5조</BoldText>
        <Icon>
          <NavItem>
            <svg
              xmlns="http://www.w3.org/2000/svg"
              width="24"
              height="24"
              viewBox="0 0 24 24"
              fill="none"
              stroke="currentColor"
              stroke-width="2"
              stroke-linecap="round"
              stroke-linejoin="round"
              class="icon icon-tabler icons-tabler-outline icon-tabler-brand-instagram"
            >
              <path stroke="none" d="M0 0h24v24H0z" fill="none" />
              <path d="M4 4m0 4a4 4 0 0 1 4 -4h8a4 4 0 0 1 4 4v8a4 4 0 0 1 -4 4h-8a4 4 0 0 1 -4 -4z" />
              <path d="M12 12m-3 0a3 3 0 1 0 6 0a3 3 0 1 0 -6 0" />
              <path d="M16.5 7.5l0 .01" />
            </svg>
          </NavItem>
          <NavItem icon="ti ti-book" />
        </Icon>
      </FooterContent>
    </FooterContainer>
  );
}
